import React, { useState } from 'react';
import './Contact.css';

const Contact = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    mobile: '',
    enquiry: '',
    needs: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // You can add code here to handle the form submission, e.g., send data to a backend server or an API.
    console.log('Form data:', formData);
  };

  return (
    <div className="contact-page">
      <div className="contact-page__container">
        {/* Left Side - Contact Form */}
        <div className="contact-card">
          <h2>Contact Us</h2>
          <form className="contact-form" onSubmit={handleSubmit}>
            <div className="form-group">
              <label htmlFor="name">Name</label>
              <input type="text" id="name" name="name" value={formData.name} onChange={handleChange} required />
            </div>
            <div className="form-group">
              <label htmlFor="email">Email</label>
              <input type="email" id="email" name="email" value={formData.email} onChange={handleChange} required />
            </div>
            <div className="form-group">
              <label htmlFor="mobile">Mobile No</label>
              <input type="text" id="mobile" name="mobile" value={formData.mobile} onChange={handleChange} required />
            </div>
            <div className="form-group">
              <label htmlFor="enquiry">Enquiry</label>
              <textarea id="enquiry" name="enquiry" value={formData.enquiry} onChange={handleChange} required />
            </div>
            <div className="form-group">
              <label htmlFor="needs">What You Need</label>
              <textarea id="needs" name="needs" value={formData.needs} onChange={handleChange} required />
            </div>
            <button type="submit">Submit</button>
          </form>
        </div>

        {/* Right Side - Company Contact Information */}
        <div className="contact-info">
        <h3>Contact Us</h3>
          <h3>Manorma Metal</h3>
          <p>Shop no. 4, Second Floor</p>
          <p>Ekta Complex, nr. Ajay Estate</p>
          <p> Rakhiyal, Ahmedabad, Gujrat(380023)</p>
          <a href='www.gmail.com' >
          <p>Email: manormametal2020@gmail.com</p>
          </a>
          <p>Phone: +91-7990685090</p>
        </div>
      </div>
    </div>
  );
};

export default Contact;
